import React from 'react'

export default function Message({item, user}) {
    return (
        <div>
            <div className={"msgInfo"}>
                <p className={"name you"} style={{color: user.color}}>{item.user}</p>
                <p className={"timestamp text you"}>at {item.timestamp}</p>
            </div>

            <p className={"text you"}>Hi</p>
        </div>
    )
}
